	            radius,
	            tubeRadius,
	            center,
	            bounds,
	            nodes,
	            objects,
	            decals,
	            iflMaterials,
	            subShapeFirstNode,
	            subShapeFirstObject,
	            subShapeFirstDecal,
	            subShapeNumNodes,
	            subShapeNumObjects,
	            subShapeNumDecals,
